DROP TABLE IF EXISTS `o_logistics_company`;
CREATE TABLE `o_logistics_company` (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `platform_id` int DEFAULT NULL COMMENT '平台id',
  `shop_id` int DEFAULT NULL COMMENT '店铺ID',
