-- ----------------------------
-- Table structure for o_shipment
-- ----------------------------
DROP TABLE IF EXISTS `o_shipment`;
CREATE TABLE `o_shipment` (
  `id` bigint NOT NULL,
  `shop_id` int DEFAULT NULL COMMENT '店铺id',
